    false,nt"url": null,nt"notes": "The Geographic Information Retrieval and
    Analysis System (GIRAS) was developed in the mid 70s to put into digital form a
    number of data layers which were of interest to the USGS. One of these data layers
    was the Hydrologic Units. The map is based on the Hydrologic Unit Maps published
    by the U.S. Geological Survey Office of Water Data Coordination, together with the
    list descriptions and name of region, subregion, accounting units, and cataloging
    unit. The hydrologic units are encoded with an eight- digit number that indicates
    the hydrologic region (first two digits), hydrologic subregion (second two digits),
    accounting unit (third two digits), and cataloging unit (fourth two digits). The
    data produced by GIRAS was originally collected at a scale of 1:250K. Some areas,
    notably major cities in the west, were recompiled at a scale of 1:100K. In order
    to join the data together and use the data in a geographic information system (GIS)
    the data were processed in the ARC/INFO GUS software package. Within the GIS, the
    data were edgematched and the neatline boundaries between maps were removed to create
    a single data set for the conterminous United States. NOTE: A version of this data
    theme that is more throughly checked (though based on smaller-scale maps) is available
    here: http://water.usgs.gov/lookup/getspatial?huc2m HUC, GIRAS, Hydrologic Units,
    1:250 For the most current data and information relating to hydrologic unit codes
    (HUCs) please see http://water.usgs.gov/GIS/huc.html. The Watershed Boundary Dataset
    (WBD) is the most current data available for watershed delineation. See http://www.nrcs.usda.gov/wps/portal/nrcs/main/national/water/watersheds/dataset",nt"license_title":
